import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card.js';
import reportWebVitals from './reportWebVitals';
import 'tachyons';
import { robots } from './robots.js'

ReactDOM.render(
  <React.StrictMode>
    <div>
      <Card robo-id={robots[0].id} robo_name={robots[0].name} robo_email={robots[0].email}/>
      <Card robo-id={robots[1].id} robo_name={robots[1].name} robo_email={robots[1].email}/>
    </div>
  </React.StrictMode>,
  document.getElementById('root')
);

